	public int runJobInTOS(String[] args) {
		// reset status
		status = "";

		String lastStr = "";
		for (String arg : args) {
			if (arg.equalsIgnoreCase("--context_param")) {
				lastStr = arg;
			} else if (lastStr.equals("")) {
				evalParam(arg);
			} else {
				evalParam(lastStr + " " + arg);
				lastStr = "";
			}
		}

		if (clientHost == null) {
			clientHost = defaultClientHost;
		}

		if (pid == null || "0".equals(pid)) {
			pid = TalendString.getAsciiRandomString(6);
		}

		if (rootPid == null) {
			rootPid = pid;
		}
		if (fatherPid == null) {
			fatherPid = pid;
		} else {
			isChildJob = true;
		}

		if (portStats != null) {
			// portStats = -1; //for testing
			if (portStats < 0 || portStats > 65535) {
				// issue:10869, the portStats is invalid, so this client socket
				// can't open
				System.err.println("The statistics socket port " + portStats
						+ " is invalid.");
				execStat = false;
			}
		} else {
			execStat = false;
		}

		try {
			// call job/subjob with an existing context, like:
			// --context=production. if without this parameter, there will use
			// the default context instead.
			java.io.InputStream inContext = test_taille_3.class
					.getClassLoader().getResourceAsStream(
							"local_project/test_taille_3_0_1/contexts/"
									+ contextStr + ".properties");
			if (inContext == null) {
				inContext = test_taille_3.class
						.getClassLoader()
						.getResourceAsStream(
								"config/contexts/" + contextStr + ".properties");
			}
			if (inContext != null) {
				// defaultProps is in order to keep the original context value
				defaultProps.load(inContext);
				inContext.close();
				context = new ContextProperties(defaultProps);
			} else if (!isDefaultContext) {
				// print info and job continue to run, for case: context_param
				// is not empty.
				System.err.println("Could not find the context " + contextStr);
			}

			if (!context_param.isEmpty()) {
				context.putAll(context_param);
				// set types for params from parentJobs
				for (Object key : context_param.keySet()) {
					String context_key = key.toString();
					String context_type = context_param
							.getContextType(context_key);
					context.setContextType(context_key, context_type);

				}
			}
			context.setContextType("chemin_entree", "id_String");

			context.chemin_entree = (String) context
					.getProperty("chemin_entree");
			context.setContextType("chemin_sortie", "id_String");

			context.chemin_sortie = (String) context
					.getProperty("chemin_sortie");
			context.setContextType("support", "id_Integer");

			try {
				context.support = routines.system.ParserUtils
						.parseTo_Integer(context.getProperty("support"));
			} catch (NumberFormatException e) {
				System.err.println(String.format(
						"Null value will be used for context parameter %s: %s",
						"support", e.getMessage()));
				context.support = null;
			}
			context.setContextType("taille", "id_Integer");

			try {
				context.taille = routines.system.ParserUtils
						.parseTo_Integer(context.getProperty("taille"));
			} catch (NumberFormatException e) {
				System.err.println(String.format(
						"Null value will be used for context parameter %s: %s",
						"taille", e.getMessage()));
				context.taille = null;
			}
			context.setContextType("test_Port", "id_String");

			context.test_Port = (String) context.getProperty("test_Port");
			context.setContextType("test_Server", "id_String");

			context.test_Server = (String) context.getProperty("test_Server");
			context.setContextType("test_Database", "id_String");

			context.test_Database = (String) context
					.getProperty("test_Database");
			context.setContextType("test_Password", "id_Password");

			String pwd_test_Password_value = context
					.getProperty("test_Password");
			context.test_Password = null;
			if (pwd_test_Password_value != null) {
				if (context_param.containsKey("test_Password")) {// no need to
																	// decrypt
																	// if it
																	// come from
																	// program
																	// argument
																	// or parent
																	// job
																	// runtime
					context.test_Password = pwd_test_Password_value;
				} else if (!pwd_test_Password_value.isEmpty()) {
					try {
						context.test_Password = routines.system.PasswordEncryptUtil
								.decryptPassword(pwd_test_Password_value);
						context.put("test_Password", context.test_Password);
					} catch (java.lang.RuntimeException e) {
						// do nothing
					}
				}
			}
			context.setContextType("test_Login", "id_String");

			context.test_Login = (String) context.getProperty("test_Login");
			context.setContextType("test_AdditionalParams", "id_String");

			context.test_AdditionalParams = (String) context
					.getProperty("test_AdditionalParams");
			context.setContextType("compteur", "id_Integer");

			try {
				context.compteur = routines.system.ParserUtils
						.parseTo_Integer(context.getProperty("compteur"));
			} catch (NumberFormatException e) {
				System.err.println(String.format(
						"Null value will be used for context parameter %s: %s",
						"compteur", e.getMessage()));
				context.compteur = null;
			}
			context.setContextType("generation_candidat", "id_String");

			context.generation_candidat = (String) context
					.getProperty("generation_candidat");
		} catch (java.io.IOException ie) {
			System.err.println("Could not load context " + contextStr);
			ie.printStackTrace();
		}

		// get context value from parent directly
		if (parentContextMap != null && !parentContextMap.isEmpty()) {
			if (parentContextMap.containsKey("chemin_entree")) {
				context.chemin_entree = (String) parentContextMap
						.get("chemin_entree");
			}
			if (parentContextMap.containsKey("chemin_sortie")) {
				context.chemin_sortie = (String) parentContextMap
						.get("chemin_sortie");
			}
			if (parentContextMap.containsKey("support")) {
				context.support = (Integer) parentContextMap.get("support");
			}
			if (parentContextMap.containsKey("taille")) {
				context.taille = (Integer) parentContextMap.get("taille");
			}
			if (parentContextMap.containsKey("test_Port")) {
				context.test_Port = (String) parentContextMap.get("test_Port");
			}
			if (parentContextMap.containsKey("test_Server")) {
				context.test_Server = (String) parentContextMap
						.get("test_Server");
			}
			if (parentContextMap.containsKey("test_Database")) {
				context.test_Database = (String) parentContextMap
						.get("test_Database");
			}
			if (parentContextMap.containsKey("test_Password")) {
				context.test_Password = (java.lang.String) parentContextMap
						.get("test_Password");
			}
			if (parentContextMap.containsKey("test_Login")) {
				context.test_Login = (String) parentContextMap
						.get("test_Login");
			}
			if (parentContextMap.containsKey("test_AdditionalParams")) {
				context.test_AdditionalParams = (String) parentContextMap
						.get("test_AdditionalParams");
			}
			if (parentContextMap.containsKey("compteur")) {
				context.compteur = (Integer) parentContextMap.get("compteur");
			}
			if (parentContextMap.containsKey("generation_candidat")) {
				context.generation_candidat = (String) parentContextMap
						.get("generation_candidat");
			}
		}

		// Resume: init the resumeUtil
		resumeEntryMethodName = ResumeUtil
				.getResumeEntryMethodName(resuming_checkpoint_path);
		resumeUtil = new ResumeUtil(resuming_logs_dir_path, isChildJob, rootPid);
		resumeUtil.initCommonInfo(pid, rootPid, fatherPid, projectName,
				jobName, contextStr, jobVersion);

		List<String> parametersToEncrypt = new java.util.ArrayList<String>();
		parametersToEncrypt.add("test_Password");
		// Resume: jobStart
		resumeUtil.addLog("JOB_STARTED", "JOB:" + jobName,
				parent_part_launcher, Thread.currentThread().getId() + "", "",
				"", "", "",
				resumeUtil.convertToJsonText(context, parametersToEncrypt));

		if (execStat) {
			try {
				runStat.openSocket(!isChildJob);
				runStat.setAllPID(rootPid, fatherPid, pid, jobName);
				runStat.startThreadStat(clientHost, portStats);
				runStat.updateStatOnJob(RunStat.JOBSTART, fatherNode);
			} catch (java.io.IOException ioException) {
				ioException.printStackTrace();
			}
		}

		java.util.concurrent.ConcurrentHashMap<Object, Object> concurrentHashMap = new java.util.concurrent.ConcurrentHashMap<Object, Object>();
		globalMap.put("concurrentHashMap", concurrentHashMap);

		long startUsedMemory = Runtime.getRuntime().totalMemory()
				- Runtime.getRuntime().freeMemory();
		long endUsedMemory = 0;
		long end = 0;

		startTime = System.currentTimeMillis();

		this.globalResumeTicket = true;// to run tPreJob

		try {
			errorCode = null;
			tPrejob_1Process(globalMap);
			if (!"failure".equals(status)) {
				status = "end";
			}
		} catch (TalendException e_tPrejob_1) {
			globalMap.put("tPrejob_1_SUBPROCESS_STATE", -1);

			e_tPrejob_1.printStackTrace();

		}

		this.globalResumeTicket = false;// to run others jobs

		try {
			errorCode = null;
			tFileInputDelimited_1Process(globalMap);
			if (!"failure".equals(status)) {
				status = "end";
			}
		} catch (TalendException e_tFileInputDelimited_1) {
			globalMap.put("tFileInputDelimited_1_SUBPROCESS_STATE", -1);

			e_tFileInputDelimited_1.printStackTrace();

		}

		this.globalResumeTicket = true;// to run tPostJob

		try {
			errorCode = null;
			tPostjob_1Process(globalMap);
			if (!"failure".equals(status)) {
				status = "end";
			}
		} catch (TalendException e_tPostjob_1) {
			globalMap.put("tPostjob_1_SUBPROCESS_STATE", -1);

			e_tPostjob_1.printStackTrace();

		}

		end = System.currentTimeMillis();

		if (watch) {
			System.out.println((end - startTime) + " milliseconds");
		}

		endUsedMemory = Runtime.getRuntime().totalMemory()
				- Runtime.getRuntime().freeMemory();
		if (false) {
			System.out.println((endUsedMemory - startUsedMemory)
					+ " bytes memory increase when running : test_taille_3");
		}

		if (execStat) {
			runStat.updateStatOnJob(RunStat.JOBEND, fatherNode);
			runStat.stopThreadStat();
		}
		int returnCode = 0;
		if (errorCode == null) {
			returnCode = status != null && status.equals("failure") ? 1 : 0;
		} else {
			returnCode = errorCode.intValue();
		}
		resumeUtil.addLog("JOB_ENDED", "JOB:" + jobName, parent_part_launcher,
				Thread.currentThread().getId() + "", "", "" + returnCode, "",
				"", "");

		return returnCode;

	}

